// src/components/auth/LoginForm.js
import React from 'react';

const LoginForm = () => {
  return (
    <div>
      <h2>Giriş Yap</h2>
      <form>
        <div>
          <label>Kullanıcı Adı:</label>
          <input type="text" />
        </div>
        <div>
          <label>Şifre:</label>
          <input type="password" />
        </div>
        <button type="submit">Giriş Yap</button>
      </form>
    </div>
  );
};

export default LoginForm;
